import { BrowserRouter, Routes, Route } from 'react-router-dom';
import './App.css';
import Home from './components/Home';
import AboutUs from './components/About Us'
import ContactUs from './components/ContactUs';
import FeedBack from './components/FeedBack';
import Courses from './components/Courses';
import Feestructure from'./components/Feestructure';
import RegisterHere from'./components/RegisterHere';
import AdminLogIn from './admin/AdminLogIn';
import AdminNav from './admin/AdminNav';
import Userlogin from './User/Userlogin';
import Dashboard from './admin/Dashboard';
import Addteachers from './admin/Addteachers';
import Addstudents from './admin/Addstudents';
import Approvetrials from './admin/Approvetrials';
import Allteachers from './admin/Allteachers';
import Allstudents from './admin/Allstudents.js';
import Userdashboard from './User/userdashboard';

function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/aboutus" element={<AboutUs />} />
          <Route path="/contactus" element={<ContactUs />} />
          <Route path="/FeedBack" element={<FeedBack/>} />
          <Route path="/Courses" element={<Courses/>} />
          <Route path="/Feestructure" element={<Feestructure/>} />
          <Route path="/RegisterHere" element={<RegisterHere/>} />
          <Route path="/AdminLogIn" element={<AdminLogIn/>} />
          <Route path="/AdminNav" element={<AdminNav/>} />
          <Route path="/userdashboard" element={<Userdashboard/>} />
          <Route path="/Userlogin" element={<Userlogin/>} />
          <Route path="/Dashboard" element={<Dashboard/>} />
          <Route path="/Addteachers" element={<Addteachers/>} />
          <Route path="/Addstudents" element={<Addstudents/>} />
          <Route path="/Approvetrials" element={<Approvetrials/>} />
          <Route path="/Allteachers" element={<Allteachers/>} />
          <Route path="/Allstudents" element={<Allstudents/>} />


        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
